import { useState } from 'react';

const DarkMode = () => {
  return (
    <div className="dark-mode">
      <h1>Dark Mode</h1>
      <label>
        <input type="checkbox" /> Use dark mode?
      </label>
    </div>
  );
};

export default DarkMode;
